export default function App() {
  return (
    <div className="App">
     <h1>Weather App</h1>
     <footer> This project was coded by <a href='https://github.com/MadameAmaka' target='_blank'> Amaka Onwuli </a> and is <a href='https://github.com/MadameAmaka/react_weather_project' target='_blank'>
    open-sourced </a>on Github </footer>
    </div>
  );
}
